// src/components/Skills.js
import React from 'react';
import './Skills.css';

const Skills = () => {
  return (
    <div className="Skills">
      <h1>My Skills</h1>
      <ul>
        <li className="Skill-Section">Java</li>
        <li className="Skill-Section">Spring Boot</li>
        <li className="Skill-Section">ReactJS</li>
        <li className="Skill-Section">HTML & CSS</li>
        <li className="Skill-Section">JavaScript</li>
        <li className="Skill-Section">Python (Basic)</li>
        <li className="Skill-Section">REST API Development</li>
        <li className="Skill-Section">Database Management: MySQL, PostgreSQL</li>
        <li className="Skill-Section">Version Control: Git, GitHub</li>
        <li className="Skill-Section">Tools: VS Code, Spring Tool Suite, Postman</li>
      </ul>
    </div>
  );
};

export default Skills;
